function TeacherLogout({ setOpenModal }) {

    //localStorage.removeItem('teacherLoginStatus')
    //window.location.href='/teacher-login';
    const teacherLoginStatus=localStorage.removeItem('teacherLoginStatus')
     if(teacherLoginStatus==='true'){
        window.location.href='/teacher-profile';
     }
    return (
        <>
        <div className="modal-background">    
        <div className="body"> 
        <div className="titleCloseBtn">
          <img id="closeImage" src={"https://icon-library.com/images/x-button-icon/x-button-icon-20.jpg"} alt=".." onClick={() => {setOpenModal(false);  }} width="30px" height="30px"/>
        </div>  

          <div className="title"> 
            <h1>Растау</h1>
            <h6>Аккаунттан шыққыңыз келе ме?</h6>
            <div>
                <Link to=''><button >Иә!</button></Link>
            </div>
          </div>       
        </div>       
    </div>
        
        </>
    );
}
export default TeacherLogout;
